<!DOCTYPE html>
<html>
  <head><base href="https://keyforu.net/">
    <meta charset="utf-8" />
    <title>KeysForU</title>
    <script type="text/javascript">
      var segmentCount = 0;
      var l = window.location;
      l.replace(
        l.protocol +
          '//' +
          l.hostname +
          (l.port ? ':' + l.port : '') +
          l.pathname
            .split('/')
            .slice(0, 1 + segmentCount)
            .join('/') +
          '/?p=/' +
          l.pathname
            .slice(1)
            .split('/')
            .slice(segmentCount)
            .join('/')
            .replace(/&/g, '~and~') +
          (l.search ? '&q=' + l.search.slice(1).replace(/&/g, '~and~') : '') +
          l.hash,
      );
    </script>
  </head>

  <body><script type="text/javascript" src="react.b8f395caae42cbccfe48.js"></script><script type="text/javascript" src="app.bundle.b717fdcba3519d6f541b.js"></script></body>
</html>
